import styles from '../components/QueueManager.module.css'
import { useEffect, fetchData, useState } from 'react';
import axios from 'axios';

function QueueManager(){  
  const [jsonData, setJsonData] = useState(null);

  useEffect(() => {
    fetch('https://localhost:9443/ibmmq/rest/v1/admin/qmgr')
      .then(response => response.json())
      .then(data => setJsonData(data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <nav>
      <table className={styles.queueManagerTable}>
          <tr>
            <th>queue name</th>
            <th>type</th>
            <th>depth</th>
            <th>ambiente</th>
          </tr> 
          <tr>
          {jsonData.map(item => (
            <th key={item.id}>{item.qmgr.name}</th>
          ))}
          </tr>           
      </table>
      </nav>
    </div>
  );
}


export default QueueManager;



